(1, '9', NULL, 'bien-en-vente-1', NULL, '<h1>Charmante Maison &agrave; Louer</h1>\r\n<p>D&eacute;couvrez cette magnifique maison situ&eacute;e dans un quartier paisible, id&eacute;ale pour les familles et les professionnels.</p>\r\n<h2>Caract&eacute;ristiques de la Maison</h2>\r\n<ul>\r\n<li><strong>Superficie :</strong> 150 m&sup2;</li>\r\n<li><strong>Chambres :</strong> 3</li>\r\n<li><strong>Salles de bain :</strong> 2</li>\r\n<li><strong>Jardin :</strong> Oui, avec terrasse</li>\r\n</ul>\r\n<h2>Description</h2>\r\n<p>Cette maison spacieuse dispose d\'un grand salon lumineux avec de grandes fen&ecirc;tres qui apportent une belle lumi&egrave;re naturelle. La cuisine est enti&egrave;rement &eacute;quip&eacute;e avec des appareils modernes et un coin repas convivial.</p>\r\n<p>&Agrave; l\'&eacute;tage, vous trouverez trois chambres confortables, parfaites pour se reposer apr&egrave;s une longue journ&eacute;e. La chambre principale est accompagn&eacute;e d\'une salle de bain priv&eacute;e pour plus d\'intimit&eacute;.</p>\r\n<h2>&Agrave; Proximit&eacute;</h2>\r\n<p>Profitez de la proximit&eacute; de :</p>\r\n<ul>\r\n<li>&Eacute;coles (&agrave; moins de 5 minutes &agrave; pied)</li>\r\n<li>Commodit&eacute;s (supermarch&eacute;s, pharmacies)</li>\r\n<li>Parcs et espaces verts</li>\r\n<li>Transports en commun</li>\r\n</ul>\r\n<h2>Conditions de Location</h2>\r\n<p>Le loyer est de <strong>1500&euro; par mois</strong>, avec un d&eacute;p&ocirc;t de garantie de <strong>3000&euro;</strong>. Les animaux de compagnie sont autoris&eacute;s sous condition.</p>\r\n<h2>Contact</h2>\r\n<p>Pour plus d\'informations ou pour planifier une visite, veuillez contacter :</p>\r\n<p><strong>Jean Dupont</strong><br>T&eacute;l&eacute;phone : 0123 456 789<br>Email : <a href=\"mailto:jean.dupont@example.com\">jean.dupont@example.com</a></p>', NULL, NULL, 'BIEN EN VENTE', 5000000, NULL, 2500, '1', NULL, 'brofodoumeekro', NULL, NULL, NULL, '1', '1', NULL, 0, NULL, NULL, 0, NULL, '500', 'M', 1, NU