(45, '7', NULL, 'reservation-45', NULL, '<p>🚨Appartement Meubl&eacute; 2 chambres + 1 salon + 1 salle &agrave; manger + balcon</p>\r\n<p>📍Situ&eacute; en plein centre de <strong>la Riviera Palmerais</strong> non loin de la pharmacie du bonheur situ&eacute; au 1er &eacute;tage.&nbsp;</p>\r\n<p>✅ 1 hall d&rsquo;entr&eacute;e&nbsp;<br>✅ 1 grand salon &eacute;quip&eacute; de TV<br>✅ 1 salle &agrave; manger&nbsp;<br>✅ 1 chambres principales climatis&eacute;e avec 1 lit King size de 3 places avec sa douche + t&eacute;l&eacute;&nbsp;<br>✅ 1 chambres secondaire climatis&eacute;e avec 2 lits s&eacute;par&eacute;s de 2 laves avec sa douche + t&eacute;l&eacute;<br>✅ 1 salle d&rsquo;eau visiteur ind&eacute;pendante&nbsp;<br>✅ 1 balcon avec une table et 2 chaises&nbsp;<br>✅ 1 salle de repassage avec un fer et une table de repassage&nbsp;<br>✅ 1 cuisine totalement &eacute;quip&eacute;e ( cuisini&egrave;re, frigo, machine &agrave; laver , cuisini&egrave;re)</p>\r\n<p>__Comodit&eacute;s_<br>✅ TV avec abonnement Canal horizon&nbsp;<br>✅ Connexion internet wifi&nbsp;<br>✅ Netflix&nbsp;<br>✅ Jeux de soci&eacute;t&eacute;&nbsp;<br>✅ Machine &agrave; laver&nbsp;<br>✅ Fer &agrave; repasser&nbsp;<br>✅ chauffe eau&nbsp;<br>✅Gazini&egrave;re<br>✅r&eacute;frig&eacute;rateur&nbsp;<br>✅Micro-onde<br>✅ Parking s&eacute;curis&eacute; avec vigiles</p>\r\n<p><strong>Prix : 60 000 FCFA / jour&nbsp;</strong></p>\r\n<p><em>Option : Possible de fermer une chambre si vous souhaitez utiliser uniquement la chambre principe et le salon. Dans ce cas le tarif sera de 35 000 fcfa / jour&nbsp;</em></p>\r\n<p class=\"MsoNormal\"><strong><em><span style=\"font-family: \'Book Antiqua\',serif;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; NB</span></em></strong><em><span style=\"font-family: \'Book Antiqua\',serif;\">: Possibilit&eacute; de r&eacute;duction pour les longs s&eacute;jours&nbsp;</span></em></p>\r\n<p class=\"MsoNormal\"><strong><em><span style=\"font-family: \'Lucida Sans Typewriter\';\"><span style=\"mso-sp