(49, '7', NULL, 'reservation-49', NULL, '<p>𝗥𝗘𝗦𝗜𝗗𝗘𝗡𝗖𝗘 &nbsp;𝟯 𝗣𝗜𝗘𝗖𝗘𝗦 situ&eacute;e &agrave; <strong>COCODY RIVIERA PALMERAIE SAINT VIATEUR</strong>, disponible pour vos manifestations diverses en toute intimit&eacute; et &eacute;galement pour les courts et longs s&eacute;jours &agrave; des tarifs r&eacute;duits et promotionnels tout ce mois.</p>\r\n<p>Balcon avant et arri&egrave;re, grande cuisine, grand salon spacieux, 2 grandes chambres avec 2 sanitaires et le tout dans un environnement calme, discret et s&eacute;curis&eacute;, captez vos &eacute;motions en toute qui&eacute;tude.</p>\r\n<p class=\"MsoNormal\"><strong>Prix :&nbsp;</strong> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; La nuit&eacute;e de 12h &agrave; 12h</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-bottom: 0cm; mso-add-space: auto; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><!-- [if !supportLists]--><span style=\"mso-ascii-font-family: Calibri; mso-fareast-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\"><span style=\"mso-list: Ignore;\">-<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>&nbsp; &nbsp; &nbsp;</strong></span></span></span><strong><!--[endif]-->50 000 F / jour (24h)</strong></p>\r\n<p class=\"MsoListParagraph\" style=\"margin-bottom: 0cm; mso-add-space: auto; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><!-- [if !supportLists]--><span style=\"mso-ascii-font-family: Calibri; mso-fareast-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri;\"><span style=\"mso-list: Ignore;\">-<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<em> &nbsp; </em></span></span></span><em>Forfait 1 semaine (7 jo