INSERT INTO `testimonials` (`id`, `user_id`, `message`, `validated`, `created_at`, `updated_at`) VALUES
(11, '1', '<p><em>Une exp&eacute;rience exceptionnelle avec BAJORAH</em></p>\n<p>En tant que nouvel investisseur dans l\'immobilier, j\'avais besoin d\'un accompagnement professionnel et fiable. Gr&acirc;ce &agrave; BAJORAH, j\'ai non seulement trouv&eacute; le bien id&eacute;al &agrave; Cocody, mais j\'ai &eacute;galement b&eacute;n&eacute;fici&eacute; d\'un service client impeccable. Leur &eacute;quipe a su r&eacute;pondre &agrave; toutes mes questions et m\'a guid&eacute; tout au long du processus d\'achat.</p>\n<p>La plateforme est intuitive, et les annonces sont claires et d&eacute;taill&eacute;es, ce qui m\'a permis de faire des choix &eacute;clair&eacute;s rapidement. Je recommande vivement BAJORAH &agrave; toute personne souhaitant investir en C&ocirc;te d\'Ivoire, que ce soit pour l\'achat ou la location. Leur expertise en immobilier est ind&eacute;niable, et leur engagement envers la satisfaction client est un v&eacute;ritable atout.</p>', 1, '2024-11-30 07:18:08', '2024-11-30 07:18:16'),
(12, '1', '<p><em>Un accompagnement sur mesure pour mon projet immobilier</em></p>\n<p>\"J\'avais besoin de vendre rapidement mon appartement &agrave; Abidjan, et BAJORAH a d&eacute;pass&eacute; toutes mes attentes. D&egrave;s ma premi&egrave;re interaction avec leur &eacute;quipe, j\'ai &eacute;t&eacute; impressionn&eacute; par leur professionnalisme et leur disponibilit&eacute;. Ils ont pris le temps de comprendre mes besoins et ont su mettre en valeur mon bien gr&acirc;ce &agrave; une annonce claire et attrayante.</p>\n<p>En moins de deux semaines, j\'avais d&eacute;j&agrave; plusieurs visites programm&eacute;es, et la vente s\'est conclue rapidement. Ce qui m\'a marqu&eacute;, c\'est leur r&eacute;activit&eacute; et leur capacit&eacute; &agrave; me tenir inform&eacute; &agrave; chaque &eacute;tape. Je recommande BAJORAH &agrave; toute personne souhaitant vendre ou acheter en toute confiance et s&eacute;r&eacute;nit&eacute;.\"</p>', 1, '2024-11-30 07:20:05', '2024-11-30 07:20:14'),
(13, '2', '<p><em>Une exp&eacute;rience fluide et rassurante</em></p>\n<p>Je cherchais une maison &agrave; louer dans la commune de Cocody, et gr&acirc;ce &agrave; BAJORAH, j\'ai pu trouver exactement ce que je recherchais en un temps record. Le site est tr&egrave;s intuitif, et les annonces sont bien d&eacute;taill&eacute;es, ce qui m\'a permis de filtrer rapidement selon mes crit&egrave;res.</p>\n<p><strong>Le suivi de l\'&eacute;quipe a &eacute;t&eacute; impeccable du d&eacute;but &agrave; la fin, avec des conseils professionnels et une r&eacute;elle transparence dans les d&eacute;marches. Gr&acirc;ce &agrave; eux, j\'ai trouv&eacute; une maison parfaite pour ma famille. Merci &agrave; toute l\'&eacute;quipe de BAJORAH !</strong></p>', 1, '2024-11-30 08:06:44', '2024-11-30 08:07:35');
